import { useEffect, useState } from "react";
import api from "../api";
import "./Projects.css";

const BACKEND_URL = "http://localhost:5000";

export default function Projects() {
  const [projects, setProjects] = useState([]);
  const [showDetails, setShowDetails] = useState(null);
  const [showForm, setShowForm] = useState(false);

  /* ================= FETCH PROJECTS ================= */
  const fetchProjects = async () => {
    try {
      const res = await api.get("/lily");
      setProjects(res.data.data || []);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchProjects();
  }, []);

  return (
    <div className="projects-page">

      {/* ===== HEADER ===== */}
      <div className="page-header">
        <h2>Projects</h2>

        {/* âœ… ADD PROJECT BUTTON */}
        <button
          className="btn-submit"
          onClick={() => setShowForm(true)}
        >
          + Add Project
        </button>
      </div>

      {/* ================= TABLE ================= */}
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Type</th>
            <th>Location</th>
            <th>Images / Floor Plans</th>
            <th>Action</th>
          </tr>
        </thead>

        <tbody>
          {projects.map((p, i) => (
            <tr key={p.id}>
              <td>{i + 1}</td>
              <td>{p.projectName}</td>
              <td>{p.projectType}</td>
              <td>{p.location}</td>

              {/* ===== IMAGE PREVIEW ===== */}
              <td>
                {(p.images || []).slice(0, 2).map((img, idx) => (
                  <img
                    key={idx}
                    src={`${BACKEND_URL}${img.url}`}
                    alt="project"
                    className="thumb"
                    onClick={() => setShowDetails(p)}
                  />
                ))}

                {(p.floorPlans || []).slice(0, 2).map((fp, idx) => (
                  <img
                    key={idx}
                    src={`${BACKEND_URL}${fp.url}`}
                    alt="floorplan"
                    className="thumb"
                    onClick={() => setShowDetails(p)}
                  />
                ))}
              </td>

              <td>
                <button onClick={() => setShowDetails(p)}>
                  View Details
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* ================= VIEW DETAILS MODAL ================= */}
      {showDetails && (
        <div className="modal">
          <div className="modal-content">
            <h2>{showDetails.projectName}</h2>
            <p><b>Type:</b> {showDetails.projectType}</p>
            <p><b>Location:</b> {showDetails.location}</p>

            <h4>Project Images</h4>
            <div className="image-grid">
              {(showDetails.images || []).map((img, idx) => (
                <img
                  key={idx}
                  src={`${BACKEND_URL}${img.url}`}
                  alt="project"
                />
              ))}
            </div>

            <h4>Floor Plans</h4>
            <div className="image-grid">
              {(showDetails.floorPlans || []).map((fp, idx) => (
                <img
                  key={idx}
                  src={`${BACKEND_URL}${fp.url}`}
                  alt="floorplan"
                />
              ))}
            </div>

            <button
              className="btn-close"
              onClick={() => setShowDetails(null)}
            >
              Close
            </button>
          </div>
        </div>
      )}

      {/* ================= ADD PROJECT FORM (PLACEHOLDER) ================= */}
      {showForm && (
        <div className="modal">
          <div className="modal-content">
            <h2>Add Project</h2>

            {/* You already have this form in your previous code */}
            <p>ðŸ‘‰ Project form goes here</p>

            <button
              className="btn-close"
              onClick={() => setShowForm(false)}
            >
              Close
            </button>
          </div>
        </div>
      )}

    </div>
  );
}
